import React from 'react';
import { Timeline, Text } from '@mantine/core';

function TimelineComponent() {
    return (
        <Timeline bulletSize={24} lineWidth={2}>
          <Timeline.Item title="Mathematical Olympiad Seminarist">
            <Text color="dimmed" size="sm"> Mathematical Olimpiad Workshops in <Text variant="link" component="span" inherit href="https://fi.ort.edu.uy/78235/33">Universidad ORT</Text> and Universidad de Montevideo.</Text>
            <Text size="xs" mt={4}>2019 - 2020</Text>
          </Timeline.Item>

          <Timeline.Item  title="Mathematical Olympiad Workshop Lecturer">
            <Text color="dimmed" size="sm">Weekly workshops in PREU High School.</Text>
            <Text size="xs" mt={4}>2019</Text>
          </Timeline.Item>

          <Timeline.Item title="Pull request"  lineVariant="dashed">
            <Text color="dimmed" size="sm">You&apos;ve submitted a pull request<Text variant="link" component="span" inherit>Fix incorrect notification message (#187)</Text></Text>
            <Text size="xs" mt={4}>34 minutes ago</Text>
          </Timeline.Item>

          <Timeline.Item title="Code review">
            <Text color="dimmed" size="sm"><Text variant="link" component="span" inherit>Robert Gluesticker</Text> left a code review on your pull request</Text>
            <Text size="xs" mt={4}>12 minutes ago</Text>
          </Timeline.Item>
        </Timeline>
      );
}

export default TimelineComponent;
